import logo from './logo.svg';
import './App.css';

const App = ()=> {
  return (
    <div className="App">
    <div><Header/></div>
     <h1> React </h1>
     <ul>
       <li> HTML 1 2</li>
       <li> CSS </li>
       <li> JS </li>
     </ul>
    </div>
  );
}
const Header = ()=> {
  return
  <div className = "ford">
    <h1> Ford fusion</h1> 
    <h1> Sonata</h1>  
   </div>
}

export default App;
